import React, { useState } from 'react';

const BookingConfirmation = () => {
  const [showCalendarOptions, setShowCalendarOptions] = useState(false);

  const eventDetails = {
    title: 'Work.Life',
    start: '',
    description: 'Thank you for booking with us!',
    location: 'Work.Life Bermondsey',
  };

  const addToCalendar = (calendarType) => {
    let url = '';

    switch (calendarType) {
        case 'Google':
          url = `https://calendar.google.com/calendar/render?action=TEMPLATE&text=${encodeURIComponent(
            eventDetails.title
          )}&dates=${eventDetails.start.replace(/[-:]/g, '')}/${eventDetails.start
            .replace(/[-:]/g, '')
            .slice(0, -2)}&details=${encodeURIComponent(
            eventDetails.description
          )}&location=${encodeURIComponent(eventDetails.location)}`;
          break;
          case 'Outlook.com': {
            const outlookUrl = `https://outlook.live.com/calendar/0/deeplink/compose?subject=${encodeURIComponent(
              eventDetails.title
            )}&body=${encodeURIComponent(
              eventDetails.description
            )}&location=${encodeURIComponent(eventDetails.location)}&startdt=${encodeURIComponent(
              eventDetails.start
            )}&enddt=${encodeURIComponent(eventDetails.end)}`;
            window.open(outlookUrl, '_blank');
            break;
          }
          case 'Apple':
        case 'Office365':
          alert('Office365 Calendar option is not implemented yet!');
          break;
        case 'Yahoo':
          alert('Yahoo Calendar option is not implemented yet!');
          break;
        default:
          console.error('Unknown calendar type');
      }

    if (url) {
      window.open(url, '_blank');
    }
  };

  return (
    <div className="booking-container">
      <h1>Thank you for your booking, see you soon!</h1>
      <div className="details">
        <p>Work.Life Bermondsey</p>
        <p>Tuesday 21 January</p>
        <p>02.30pm</p>
      </div>
      <button
        className="btn"
        onClick={() => setShowCalendarOptions(!showCalendarOptions)}
      >
        Add to calendar
      </button>
      {showCalendarOptions && (
        <div className="calendar-options">
          <div className="calendar-option" onClick={() => addToCalendar('Apple')}>
            <img src="https://cdn-icons-png.flaticon.com/512/888/888859.png" alt="Apple" />
            <span>Apple</span>
          </div>
          <div className="calendar-option" onClick={() => addToCalendar('Google')}>
            <img src="https://cdn-icons-png.flaticon.com/512/300/300221.png" alt="Google" />
            <span>Google</span>
          </div>
          <div className="calendar-option" onClick={() => addToCalendar('Office365')}>
            <img src="https://cdn-icons-png.flaticon.com/512/732/732223.png" alt="Office365" />
            <span>Office365</span>
          </div>
          <div className="calendar-option" onClick={() => addToCalendar('Outlook.com')}>
            <img src="https://cdn-icons-png.flaticon.com/512/732/732200.png" alt="Outlook.com" />
            <span>Outlook.com</span>
          </div>
          <div className="calendar-option" onClick={() => addToCalendar('Yahoo')}>
            <img src="https://cdn-icons-png.flaticon.com/512/732/732245.png" alt="Yahoo" />
            <span>Yahoo</span>
          </div>
        </div>
      )}
      <p>Please let us know how you heard about us</p>
      <select className="dropdown">
        <option value="">Please Select</option>
        <option value="Google">Google</option>
        <option value="Friend">Friend</option>
        <option value="Advertisement">Advertisement</option>
        <option value="Social Media">Social Media</option>
      </select>
      <button className="submit-btn">Submit</button>
    </div>
  );
};

export default BookingConfirmation;
